import Create from '../page2/Create';
import '../App.css';
import Login from '../Login';
function MainPage() {
	return (
		<div>
			<Navbar1 />
			<Hero />
			<MindofReader />
			<Tops />
			<Login />
		</div>
	);
}

export default MainPage;
